import "./password.css";
const password = () => {
  return (
    <div className="password-page">
      <div className="bg-4-1">
        <button className="rectangle-16">RESET PASSWORD</button>
        <div className="rectangle-17">
          <div className="flex-container">
            <form>
            <h4> Phone Number<input type="text" className="rectangle-18" placeholder="9003-yyy" ></input></h4>
            <h4>New Password<input type="text" className="rectangle-19" placeholder="**"></input></h4>
            <h4> Re-enter Password<input type="text" className="rectangle-20" placeholder="**" ></input></h4>
            </form>
          </div>
        </div>
        <div className="flex-container-1">
          <button className="rectangle-21">SIGN UP</button>
          <button className="rectangle-16-1">RESET</button>
          <button className="rectangle-22">LOGIN</button>
        </div>
      </div>
    </div>
  );
};
export default password;
